import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'typeface-roboto';
import {AppBar, Toolbar, Tabs, Typography, Tab} from '@material-ui/core'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const AlertsPage = () => <h1>Alerts</h1>;

function App() {
  return (
    <Router>
    <AppBar position="static">
  <Toolbar>
    <Typography variant="h4" style={{marginRight: '30px'}}>
      Fire Buster
    </Typography>
    <Tabs>
      <Route exact path="/Alerts" component={AlertsPage} />
      <Tab label='Alerts' index={0}/>
      <Tab label='Report Wildfire' index={1}/>
      <Tab label='Statistics' index={2}/>
    </Tabs>
  </Toolbar>
</AppBar>
</Router>
  );
}

export default App;
